import { Routes } from 'react-router-dom';
import './App.css';
import Admin_training from './admin_component/create_training';
// import View_training from './view_trainings';


function App() {
  return (
    <div className="App">
      <Route>
      <Routes path='/admin_training' element={ <Admin_training/>}/>
      </Route>
    </div>
  );
}

export default App;
